  return (

    <Router forceRefresh={true}>

     <Routes>
      <GlobalContextProvider>
      <Route path='/' element={<HomePage/>}/>
      <Route path='/tollpage' element={<TollViewPage/>}/>
      </GlobalContextProvider>





    </Routes>
    </Router>


  );
}

export default App;
